INSERT INTO `baitap` (`id`,`ten`,`muc`,`noidung`) VALUES ('6','Bai 1 - KT Thuc hanh','KT11Hk2','Bài 1: Viết chương trình nhập toạ độ 3 đỉnh của ΔABC. Tính chu vi và diện tích của ΔABC.<br/>\r\n*Yêu cầu bắt buộc: Viết và sử dụng các chương trình con sau:<br/>\r\n1. Hàm tính độ dài đoạn thẳng<br/>\r\n2. Hàm tính diện tích dựa vào 3 cạnh<br/><br/>\r\nThang điểm:<br/>\r\nTrình bày các dòng lệnh chương trình:		1đ<br/>\r\nMỗi chương trình con : 	2đ x 2CTC = 	4đ<br/>\r\nCT chạy được (ko lỗi): 		1đ<br/>\r\nTrình bày màn hình chạy chương trình: 		1đ<br/>\r\nCho kết quả đúng:	 1đ/test x 2 test = 	2đ<br/>\r\nĐúng thời gian: 		1đ<br/>\r\n\r\n<h2>Chuong trinh tham khao</h2>\r\n<pre>\r\nUses crt;\r\nVar\r\n	xA,yA,\r\n	xB,yB,\r\n	xC,yC	: real;\r\n	a, b, c : real;\r\n\r\nfunction doanthang(xM,yM,xN,yN : real) : real;\r\n	begin\r\n		doanthang:= sqrt(sqr(xM-xN)+sqr(yM-yN));\r\n	end;\r\n\r\nfunction dientich(a,b,c : real) : real;\r\n	var p : real;\r\n	begin\r\n		p:= (a+b+c)/2;\r\n		dientich:=sqrt(p*(p-a)*(p-b)*(p-c));\r\n	end;\r\n\r\nBEGIN\r\n	clrscr;\r\n	write(\'Nhap toa do diem A: \');\r\n	readln(xA,yA);\r\n	write(\'Nhap toa do diem B: \');\r\n	readln(xB,yB);\r\n	write(\'Nhap toa do diem C: \');\r\n	readln(xC,yC);\r\n	a := doanthang(xB,yB,xC,yC);\r\n	b := doanthang(xC,yC,xA,yA);\r\n	c := doanthang(xA,yA,xB,yB);\r\n	writeln(\'Chu vi cua tam giac ABC la: \',a+b+c:9:2);\r\n	writeln(\'Dien tich cua tam giac ABC la: \',dientich(a,b,c):9:2);\r\n	readln;\r\nEND.\r\n\r\n</pre>');
INSERT INTO `baitap` (`id`,`ten`,`muc`,`noidung`) VALUES ('7','Bai 2 - KT Thuc hanh','KT11Hk2','Bài 2: Nhập một dãy gồm n số nguyên A1..An. Tìm số nhỏ nhất trong dãy.<br/>\r\n*Yêu cầu bắt buộc: Viết và sử dụng chương trình con: <br/>\r\n1. Thủ tục nhapdulieu dùng để nhập dữ liệu cho n và cho mảng A<br/>\r\n2. Hàm min(a,b) để tìm số nhỏ nhất trong 2 số a,b.<br/>\r\nThang điểm:<br/>\r\nTrình bày các dòng lệnh chương trình:		1đ<br/>\r\nMỗi chương trình con : 	2đ x 2CTC = 	4đ<br/>\r\nCT chạy được (ko lỗi): 		1đ<br/>\r\nTrình bày màn hình chạy chương trình: 		1đ<br/>\r\nCho kết quả đúng:	 1đ/test x 2 test = 	2đ<br/>\r\nĐúng thời gian: 		1đ<br/>\r\n\r\n<h2>Chuong trinh tham khao</h2>\r\n<pre>\r\nUses crt;\r\nvar\r\n	n : byte;\r\n	A : Array[1..200] of integer;\r\n	i : byte;\r\n	m : integer;\r\nfunction min(a, b : integer) : integer;\r\n	begin\r\n		if a < b then\r\n			min:=a\r\n		else\r\n			min:=b;\r\n	end;\r\n\r\nprocedure nhapdulieu;\r\n	var i : byte;\r\n	begin\r\n		write(\'Nhap so phan tu: \');\r\n		readln(n);\r\n		for i:= 1 to n do begin\r\n			write(\'Nhap A[\',i,\']: \');\r\n			readln(A[i]);\r\n			end;\r\n	end;\r\n\r\nBEGIN\r\n	clrscr;\r\n	nhapdulieu;\r\n	m:=A[1];\r\n	for i:=2 to n do\r\n		m:= min(m,A[i]);\r\n	writeln(\'So nho nhat trong day la \',m);\r\n	readln;\r\nEND.\r\n</pre>');
